function UPDATE_ISO_PACKAGES {
	DISPLAY_PROGRESS "Updating ISO repositories ..."
	cd ${WIP}
	sudo rm -f iso-chroot/usr/src/.grub_packages iso-chroot/usr/src/.grub_packages.log iso-chroot/usr/src/.grub_packages.error
	PRESERVE_KEY_ISO_FILES
	sudo chroot iso-chroot /bin/bash > /dev/null 2>&1 <<+
export HOME=/root
export LC_ALL=C
trap '' SIGHUP SIGINT SIGTERM
cd /usr/src
GRUB_PACKAGES=\$(dpkg -l | grep grub | grep ^ii | awk '{print \$2}' | xargs)
echo "\${GRUB_PACKAGES}" > .grub_packages
if ${DEBUG}; then echo "Updating GRUB packages '\${GRUB_PACKAGES}' ..." > .grub_packages.log; fi
DEBIAN_FRONTEND=noninteractive apt-get install -y -o Dpkg::Options::="--force-confdef" -o Dpkg::Options::="--force-confold" \${GRUB_PACKAGES} >> .grub_packages.log 2>&1
PACKAGE_INSTALLED=\$?
if [ \${PACKAGE_INSTALLED} != 0 ]; then
	touch .grub_packages.error
fi
+
	GRUB_PACKAGES=$(sudo cat iso-chroot/usr/src/.grub_packages)
	if ${DEBUG}; then sudo cat iso-chroot/usr/src/.grub_packages.log >> ${ISORESPIN_LOGFILE}; fi
	if [ -f iso-chroot/usr/src/.grub_packages.error ]; then
		sudo cat iso-chroot/usr/src/.grub_packages.log
		DISPLAY_MESSAGE "GRUB packages '${GRUB_PACKAGES}' failed to update correctly."
		sudo rm -f iso-chroot/usr/src/.grub_packages iso-chroot/usr/src/.grub_packages.log iso-chroot/usr/src/.grub_packages.error
		CHROOT_EXIT
	else
		echo "GRUB packages '${GRUB_PACKAGES}' updated ..." >> ${ISORESPIN_LOGFILE}
		sudo rm -f iso-chroot/usr/src/.grub_packages iso-chroot/usr/src/.grub_packages.log
	fi
	if [ -d "${WIP}/iso-directory-structure/pool" ]; then
		sudo mkdir iso-chroot/usr/src/.isorespin.$$.pool
		cd iso-chroot/usr/src/.isorespin.$$.pool
		for POOL_PACKAGE in $(find ${WIP}/iso-directory-structure/pool -name \*.deb)
		do
			POOL_PACKAGE_PATH=$(dirname ${POOL_PACKAGE})
			DEBIAN_FILE=$(basename ${POOL_PACKAGE})
			PACKAGE=${DEBIAN_FILE%%_*}
			PACKAGE_CANDIDATE=$(sudo chroot ${WIP}/iso-chroot apt-cache policy ${PACKAGE} | grep -m1 Candidate)
			PACKAGE_CANDIDATE=${PACKAGE_CANDIDATE##  Candidate: }
			POOL_CANDIDATE=${DEBIAN_FILE#*_}
			POOL_CANDIDATE=${POOL_CANDIDATE%_*}
			if [ "${POOL_CANDIDATE}" != "${PACKAGE_CANDIDATE}" ]; then
				sudo chroot ${WIP}/iso-chroot bash -c "cd /usr/src/.isorespin.$$.pool; apt-get download -y ${PACKAGE}" > /dev/null 2>&1
				if [ -f ${PACKAGE}_*.deb ]; then
					sudo rm -f ${POOL_PACKAGE}
					sudo mv $(ls ${PACKAGE}*.deb) ${POOL_PACKAGE_PATH}/$(ls ${PACKAGE}*.deb | sed 's/%3a/:/')
					if ${DEBUG}; then echo "ISO package '${PACKAGE}' updated ..." >> ${ISORESPIN_LOGFILE}; fi
				fi
			fi
		done
		cd ${WIP}
		sudo rm -rf iso-chroot/usr/src/.isorespin.$$.pool
		sudo mkdir dpkg-dev
		if ! $(command -v dpkg-scanpackages > /dev/null 2>&1); then
			sudo apt-get download -y dpkg-dev > /dev/null 2>&1
			sudo dpkg-deb -x dpkg-dev_*.deb dpkg-dev
			sudo rm -f dpkg-dev_*.deb
			DPKG_DEV_PATH="../dpkg-dev/usr/bin"
		else
			DPKG_DEV_PATH=$(dirname $(type dpkg-scanpackages | awk '{print $3}'))
		fi
		if [ ! -f iso-directory-structure/dists/${DISTRO_CODENAME}/main/binary-amd64/${DISTRO_PACKAGES} ]; then
			DISPLAY_MESSAGE "Cannot update ISO repositories."
			CHROOT_EXIT
		fi
		cd iso-directory-structure
		for POOL_REPOSITORIES in pool/*
		do
			POOL_REPOSITORY=${POOL_REPOSITORIES#pool/}
			if [ ! -d "dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}" ]; then
				continue
			fi
			COMPRESSED_PACKAGES_OLD_MD5SUM=$(md5sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_OLD_SHA1SUM=$(sha1sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_OLD_SHA256SUM=$(sha256sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_OLD_SIZE=$(stat -c %s dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES})
			sudo rm -f dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages
			sudo ${ZIP_COMMAND} -d -c dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | sudo tee dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages > /dev/null
			PACKAGES_OLD_MD5SUM=$(md5sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_OLD_SHA1SUM=$(sha1sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_OLD_SHA256SUM=$(sha256sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_OLD_SIZE=$(stat -c %s dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages)
			sudo rm -f dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages
			sudo ${DPKG_DEV_PATH}/dpkg-scanpackages ${POOL_REPOSITORIES} 2> /dev/null | sudo tee dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages > /dev/null
			PACKAGES_NEW_MD5SUM=$(md5sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_NEW_SHA1SUM=$(sha1sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_NEW_SHA256SUM=$(sha256sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | awk '{print $1}')
			PACKAGES_NEW_SIZE=$(stat -c %s dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages)
			sudo rm -f dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES}
			sudo ${ZIP_COMMAND} -c dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages | sudo tee dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} > /dev/null
			COMPRESSED_PACKAGES_NEW_MD5SUM=$(md5sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_NEW_SHA1SUM=$(sha1sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_NEW_SHA256SUM=$(sha256sum dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{print $1}')
			COMPRESSED_PACKAGES_NEW_SIZE=$(stat -c %s dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES})
			sudo rm -f dists/${DISTRO_CODENAME}/${POOL_REPOSITORY}/binary-amd64/Packages
			OLD_LINE=$(echo ${PACKAGES_OLD_MD5SUM} ${PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%33s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${PACKAGES_NEW_MD5SUM} ${PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%33s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${PACKAGES_OLD_SHA1SUM} ${PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%41s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${PACKAGES_NEW_SHA1SUM} ${PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%41s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${PACKAGES_OLD_SHA256SUM} ${PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%65s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${PACKAGES_NEW_SHA256SUM} ${PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/Packages | awk '{printf "%65s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${COMPRESSED_PACKAGES_OLD_MD5SUM} ${COMPRESSED_PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%33s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${COMPRESSED_PACKAGES_NEW_MD5SUM} ${COMPRESSED_PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%33s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${COMPRESSED_PACKAGES_OLD_SHA1SUM} ${COMPRESSED_PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%41s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${COMPRESSED_PACKAGES_NEW_SHA1SUM} ${COMPRESSED_PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%41s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
			OLD_LINE=$(echo ${COMPRESSED_PACKAGES_OLD_SHA256SUM} ${COMPRESSED_PACKAGES_OLD_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%65s%9s %s\n", $1, $2, $3}')
			NEW_LINE=$(echo ${COMPRESSED_PACKAGES_NEW_SHA256SUM} ${COMPRESSED_PACKAGES_NEW_SIZE} ${POOL_REPOSITORY}/binary-amd64/${DISTRO_PACKAGES} | awk '{printf "%65s%9s %s\n", $1, $2, $3}')
			sudo sed -i "s?${OLD_LINE}?${NEW_LINE}?" dists/${DISTRO_CODENAME}/Release
		done
		# and because 'Release' has now been modified ...
		sudo rm -f dists/${DISTRO_CODENAME}/Release.gpg
		cd ..
		if ${INSTALLER_IS_CALAMARES}; then
			# calamares requires a successful return of 'apt-get update' whereas ubiquity doesn't so the 'security risk' is arguably acceptable ...
			sudo sed -i 's/apt-get update/apt-get update --allow-insecure-repositories/' iso-chroot/etc/calamares/modules/before_bootloader_context.conf
			sudo sed -i 's/apt install/apt install --allow-unauthenticated/' iso-chroot/etc/calamares/modules/before_bootloader_context.conf
		fi
		sudo rm -rf dpkg-dev
	fi
	RESTORE_KEY_ISO_FILES
	echo "ISO repositories updated ..." >> ${ISORESPIN_LOGFILE}
}

function SPIN_ISO {
	DISPLAY_PROGRESS "Spinning ISO ..."
	cd ${WIP}
	# create the manifest/packages
	sudo chmod +w iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES}
	sudo chroot iso-chroot dpkg-query -W | sudo tee iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.${FILESYSTEM_FILES} > /dev/null
	# create the filesystem
	sudo mksquashfs iso-chroot iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.squashfs
	printf $(sudo du -sxb iso-chroot | cut -f1) | sudo tee iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/filesystem.size > /dev/null
	sudo rm -rf iso-chroot
	cd iso-directory-structure
	sudo rm -f README.isorespin
	for README_ARRAY in $(seq 0 $((${#README[@]}-1)))
	do
		if [ "${README[${README_ARRAY}]}" == "--update " ]; then
			echo "${README[${README_ARRAY}]}(${MAINLINE_BRANCH})"
		elif [ "${README[${README_ARRAY}]}" == "--${ROLLING} " ]; then
			echo "${README[${README_ARRAY}]}(v${ROLLING_KERNEL_VERSION})"
		elif [ "${README[${README_ARRAY}]:0:13}" == "--repository " ]; then
			echo "${README[${README_ARRAY}]}"
			if ${SOFTWARE_PROPERTIES_COMMON_ADDED}; then
				echo -e "\\t(-p software-properties-common)"
				SOFTWARE_PROPERTIES_COMMON_ADDED=false
			fi
		elif [ "${README[${README_ARRAY}]}" == "--server " ]; then
			echo "${README[${README_ARRAY}]}"
			echo -e "\\t(-e ubuntu-desktop^)"
			echo -e "\\t(-p \"${SERVER_ADD_PACKAGES}\")"
			echo -e "\\t(-f linservin.sh)"
			echo -e "\\t(-c \"useradd -c ubuntu -d /home/ubuntu -m -g users -s /bin/bash ubuntu\")"
			echo -e "\\t(-c \"sed -i '/^root/ a ubuntu ALL=(ALL:ALL) ALL' /etc/sudoers)\""
			echo -e "\\t(-c \"passwd -d ubuntu)\""
		elif [ "${README[${README_ARRAY}]}" == "--${TARGET_PROCESSOR} " ]; then
			if [ "${TARGET_PROCESSOR}" == "apollo" ]; then
				echo "${README[${README_ARRAY}]}"
				echo -e "\\t(-b Linuxium)"
				echo -e "\\t(-p binutils)"
				echo -e "\\t(-f update-modules)"
			else
				echo "${README[${README_ARRAY}]}"
				echo -e "\\t(-l ${ATOM_WIFI_PACKAGE})"
				echo -e "\\t(-f linuxium-install-UCM-files.sh -f wrapper-linuxium-install-UCM-files.sh)"
				echo -e "\\t(-f linuxium-install-broadcom-drivers.sh -f wrapper-linuxium-install-broadcom-drivers.sh)"
				echo -e "\\t(-c wrapper-linuxium-install-UCM-files.sh -c wrapper-linuxium-install-broadcom-drivers.sh)"
			fi
		elif [ "${README[${README_ARRAY}]:0:7}" == "--boot " ]; then
			if [ "${BOOT}" == "linuxium" ]; then
				echo "${README[${README_ARRAY}]}"
				echo -e "\\t(-p binutils)"
			else
				echo "${README[${README_ARRAY}]}"
			fi
		elif [ "${README[${README_ARRAY}]}" == "--interactive " ]; then
			echo "--interactive"
			while read -r
			do
				if [ -n "${REPLY}" ]; then
					echo -e "\\t(${REPLY})"
				fi
			done <<< $(sudo sed 's/\x1B\]0;/\n/' ../interactive.log | tr -d '\r' | grep "^[^@]*@$(hostname -s)" | sed 's/^[^ ]* [^ ]* //')
			sudo rm -f ../interactive.log
		elif [ "${README[${README_ARRAY}]}" == "--debug " ]; then
			continue
		else
			echo "${README[${README_ARRAY}]}"
		fi
	done | sudo tee README.isorespin > /dev/null
	[ -f ${ISORESPIN_TEMPLATE} ] && sudo rm -f ${ISORESPIN_TEMPLATE}
	for README_ARRAY in $(seq 1 $((${#README[@]}-1)))
	do
		if [ "${README[${README_ARRAY}]:0:5}" == "--iso" ]; then
			continue
		else
			echo "${README[${README_ARRAY}]}"
		fi
	done > ${ISORESPIN_TEMPLATE}
	cd ..
	# create the iso
	if ${USE_LINUXIUM_BOOTSCRIPT}; then
		BOOT_DIRECTORY=$(ls iso-directory-structure/EFI | grep -i boot)
		sudo rm -f iso-directory-structure/EFI/${BOOT_DIRECTORY}/*
		if ${BOOT_CASPER}; then
			echo file=/cdrom/preseed/ubuntu.seed boot=casper "${LINUXIUM_BOOT_PARAMETERS}" | sudo tee iso-directory-structure/EFI/${BOOT_DIRECTORY}/cmdline > /dev/null
		else
			echo file=/cdrom/preseed/ubuntu.seed maybe-ubiquity "${LINUXIUM_BOOT_PARAMETERS}" | sudo tee iso-directory-structure/EFI/${BOOT_DIRECTORY}/cmdline > /dev/null
		fi
		sudo /usr/bin/objcopy --add-section .osrel=/etc/os-release --change-section-vma .osrel=0x20000 --add-section .cmdline=iso-directory-structure/EFI/${BOOT_DIRECTORY}/cmdline --change-section-vma .cmdline=0x30000 --add-section .linux=iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_VMLINUZ} --change-section-vma .linux=0x40000 --add-section .initrd=iso-directory-structure/${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD} --change-section-vma .initrd=0x3000000 /usr/lib/systemd/boot/efi/linuxx64.efi.stub iso-directory-structure/EFI/${BOOT_DIRECTORY}/bootx64.efi
		sudo rm -f iso-directory-structure/EFI/${BOOT_DIRECTORY}/cmdline
		SECTOR_ALIGNMENT=2048
		BOOTX64=$(basename $(find iso-directory-structure/EFI/${BOOT_DIRECTORY}/ -maxdepth 1 -iname bootx64.efi) 2> /dev/null)
		SIZE_OF_LINUXIUM_EFI=$(du -s iso-directory-structure/EFI/${BOOT_DIRECTORY}/${BOOTX64} | awk '{print $1}')
		# add 1% for filesystem overhead
		SIZE_OF_LINUXIUM_EFI=$((${SIZE_OF_LINUXIUM_EFI}+(${SIZE_OF_LINUXIUM_EFI}*1/100)))
		SECTOR_SIZE_OF_LINUXIUM_EFI=$((${SIZE_OF_LINUXIUM_EFI}*2))
		if [ $((SECTOR_SIZE_OF_LINUXIUM_EFI%SECTOR_ALIGNMENT)) == 0 ]; then
			SECTOR_SIZE_OF_LINUXIUM_EFI=$((SECTOR_SIZE_OF_LINUXIUM_EFI+1))
		fi
		sudo mkdir mnt
		sudo rm -f iso-directory-structure/boot/grub/efi.img
		sudo dd if=/dev/zero of=iso-directory-structure/boot/grub/efi.img bs=512 count=${SECTOR_SIZE_OF_LINUXIUM_EFI} status=none
		sudo mkdosfs iso-directory-structure/boot/grub/efi.img > /dev/null 2>&1
		sudo mount iso-directory-structure/boot/grub/efi.img mnt
		sudo mkdir -p mnt/efi/boot/
		sudo cp iso-directory-structure/EFI/${BOOT_DIRECTORY}/${BOOTX64} mnt/efi/boot/bootx64.efi
		sudo umount mnt
		if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
			sudo mv iso-directory-structure/boot/grub/efi.img cd-boot-images/usr/share/cd-boot-images-amd64/images/boot/grub/efi.img
		fi
		sudo rmdir mnt
	fi
	if ${USE_REFIND_BOOTMANAGER}; then
		SECTOR_ALIGNMENT=2048
		SIZE_OF_ISO_REFIND=$(du -s iso-refind | awk '{print $1}')
		SECTOR_SIZE_OF_ISO_REFIND=$((${SIZE_OF_ISO_REFIND}*2))
		END_SECTOR_OF_ISO_REFIND=$((${SECTOR_ALIGNMENT}+${SECTOR_SIZE_OF_ISO_REFIND}))
		NEXT_SECTOR_AFTER_ISO_REFIND=$((((${END_SECTOR_OF_ISO_REFIND} + ${SECTOR_ALIGNMENT} -1) / ${SECTOR_ALIGNMENT}) * ${SECTOR_ALIGNMENT}))
		SIZE_OF_ISO_DIRECTORY_STRUCTURE=$(du -s iso-directory-structure | awk '{print $1}')
		# add 8% for filesystem overhead
		SIZE_OF_ISO_DIRECTORY_STRUCTURE=$((${SIZE_OF_ISO_DIRECTORY_STRUCTURE}+(${SIZE_OF_ISO_DIRECTORY_STRUCTURE}*2/25)))
		SECTOR_SIZE_OF_ISO_DIRECTORY_STRUCTURE=$((${SIZE_OF_ISO_DIRECTORY_STRUCTURE}*2))
		if [ $((SECTOR_SIZE_OF_ISO_DIRECTORY_STRUCTURE%SECTOR_ALIGNMENT)) == 0 ]; then
			SECTOR_SIZE_OF_ISO_DIRECTORY_STRUCTURE=$((SECTOR_SIZE_OF_ISO_DIRECTORY_STRUCTURE+1))
		fi
		END_SECTOR_OF_ISO_DIRECTORY_STRUCTURE=$((${NEXT_SECTOR_AFTER_ISO_REFIND}+${SECTOR_SIZE_OF_ISO_DIRECTORY_STRUCTURE}))
		NEXT_SECTOR_AFTER_ISO_DIRECTORY_STRUCTURE=$((((${END_SECTOR_OF_ISO_DIRECTORY_STRUCTURE} + ${SECTOR_ALIGNMENT} -1) / ${SECTOR_ALIGNMENT}) * ${SECTOR_ALIGNMENT}))
		if ${ADD_PERSISTENCE}; then
			END_SECTOR_OF_PERSISTENCE=$((${NEXT_SECTOR_AFTER_ISO_DIRECTORY_STRUCTURE}+${PERSISTENCE_SECTOR_SIZE}))
			sudo dd if=/dev/zero of=../${LINUXIUM_ISO} bs=512 count=$((34+${END_SECTOR_OF_PERSISTENCE})) > /dev/null 2>&1
			(echo n; echo 1; echo ${SECTOR_ALIGNMENT}; echo ${END_SECTOR_OF_ISO_REFIND}; echo ef00; echo n; echo 2; echo ${NEXT_SECTOR_AFTER_ISO_REFIND}; echo ${END_SECTOR_OF_ISO_DIRECTORY_STRUCTURE}; echo 8300; echo n; echo 3; echo ${NEXT_SECTOR_AFTER_ISO_DIRECTORY_STRUCTURE}; echo ${END_SECTOR_OF_PERSISTENCE}; echo 8300; echo w; echo Y) | sudo gdisk ../${LINUXIUM_ISO} > /dev/null 2>&1
		else
			sudo dd if=/dev/zero of=../${LINUXIUM_ISO} bs=512 count=$((34+${END_SECTOR_OF_ISO_DIRECTORY_STRUCTURE})) > /dev/null 2>&1
			(echo n; echo 1; echo ${SECTOR_ALIGNMENT}; echo ${END_SECTOR_OF_ISO_REFIND}; echo ef00; echo n; echo 2; echo ${NEXT_SECTOR_AFTER_ISO_REFIND}; echo ${END_SECTOR_OF_ISO_DIRECTORY_STRUCTURE}; echo 8300; echo w; echo Y) | sudo gdisk ../${LINUXIUM_ISO} > /dev/null 2>&1
		fi
		sudo sync
		sudo sync
		sudo losetup -f > /dev/null 2>&1 || DISPLAY_MESSAGE "No free loop devices."
		sudo losetup -f > /dev/null 2>&1 || CLEAN_EXIT
		LOOP_DEVICE=$(sudo losetup -f)
		sudo mkdir mnt
		DISPLAY_PROGRESS "Adding ISO boot partition ..."
		sudo losetup ${LOOP_DEVICE} ../${LINUXIUM_ISO} -o $((${SECTOR_ALIGNMENT}*512)) --sizelimit $(((${END_SECTOR_OF_ISO_REFIND}-${SECTOR_ALIGNMENT})*512))
		sudo mkfs.vfat ${LOOP_DEVICE} > /dev/null 2>&1
		sudo mount ${LOOP_DEVICE} mnt
		sudo mkdir -p mnt/EFI/boot
		sudo cp -a iso-refind/. mnt/EFI/boot
		sudo sync
		sudo sync
		sudo umount mnt
		sudo losetup -d ${LOOP_DEVICE}
		DISPLAY_PROGRESS "Adding ISO file system partition ..."
		sudo losetup ${LOOP_DEVICE} ../${LINUXIUM_ISO} -o $((${NEXT_SECTOR_AFTER_ISO_REFIND}*512)) --sizelimit $(((${END_SECTOR_OF_ISO_DIRECTORY_STRUCTURE}-${NEXT_SECTOR_AFTER_ISO_REFIND})*512))
		sudo mkfs.ext4 ${LOOP_DEVICE} -L LINUXIUMISO > /dev/null 2>&1
		sudo mount ${LOOP_DEVICE} mnt
		sudo rmdir mnt/lost+found
		cd iso-directory-structure
		sudo rm -f md5sum.txt
		# new layout for respinning 20.04 ISOs and up
		if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
			echo $((sudo cpio -i; sudo cpio -i; ${CPIO_COMPRESSION} -d | sudo cpio -id conf/uuid.conf; sudo rm -r kernel; cat conf/uuid.conf; sudo rm -r conf) < ${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD} 2>/dev/null) | sudo tee .disk/casper-uuid-generic > /dev/null
			find -type f -print0 | sudo xargs -0 md5sum | grep -v boot.catalog | sudo tee md5sum.txt > /dev/null
		elif [ "${DISTRO_RELEASE}" == "20.04" ]; then
			echo $((sudo cpio -i; sudo cpio -i; ${CPIO_COMPRESSION} -d | sudo cpio -id conf/uuid.conf; sudo rm -r kernel; cat conf/uuid.conf; sudo rm -r conf) < ${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD} 2>/dev/null) | sudo tee .disk/casper-uuid-generic > /dev/null
			find -type f -print0 | sudo xargs -0 md5sum | grep -v './isolinux' | sudo tee md5sum.txt > /dev/null
		else
			find -type f -print0 | sudo xargs -0 md5sum | grep -v isolinux/boot.cat | sudo tee md5sum.txt > /dev/null
		fi
		cd ..
		sudo cp -a iso-directory-structure/. mnt
		sudo sync
		sudo sync
		sudo umount mnt
		sudo losetup -d ${LOOP_DEVICE}
		if ${ADD_PERSISTENCE}; then
			DISPLAY_PROGRESS "Adding persistence partition ..."
			sudo losetup ${LOOP_DEVICE} ../${LINUXIUM_ISO} -o $((${NEXT_SECTOR_AFTER_ISO_DIRECTORY_STRUCTURE}*512)) --sizelimit $(((${END_SECTOR_OF_PERSISTENCE}-${NEXT_SECTOR_AFTER_ISO_DIRECTORY_STRUCTURE})*512))
			sudo mkfs.ext4 ${LOOP_DEVICE} -L ${PERSISTENCE_PARTITION} > /dev/null 2>&1
			sudo losetup -d ${LOOP_DEVICE}
			echo "Persistence partition of '${PERSISTENCE_SIZE}${PERSISTENCE_UNIT}B' added ..." >> ${ISORESPIN_LOGFILE}
		fi
		sudo rmdir mnt
		sudo rm -rf $(basename ${REFIND_DIR})
		sudo rm -rf iso-refind
	else
		sudo dd if=${ISO} of=isohdpfx.bin bs=512 count=1 status=none
		cd iso-directory-structure
		sudo rm -f md5sum.txt
		# new layout for respinning 20.04 ISOs and up
		if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
			echo $((sudo cpio -i; sudo cpio -i; ${CPIO_COMPRESSION} -d | sudo cpio -id conf/uuid.conf; sudo rm -r kernel; cat conf/uuid.conf; sudo rm -r conf) < ${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD} 2>/dev/null) | sudo tee .disk/casper-uuid-generic > /dev/null
			find \( -path ./boot.catalog -o \
				-path ./boot/grub/fonts -o \
				-path ./boot/grub/i386-efi -o \
				-path ./boot/grub/i386-pc -o \
				-path ./boot/grub/x86_64-efi -o \
				-path ./EFI -o -path ./README.isorespin \) -prune -o -type f -print0 | sudo xargs -0 md5sum | sudo tee md5sum.txt > /dev/null
		elif [ "${DISTRO_RELEASE}" == "20.04" ]; then
			echo $((sudo cpio -i; sudo cpio -i; ${CPIO_COMPRESSION} -d | sudo cpio -id conf/uuid.conf; sudo rm -r kernel; cat conf/uuid.conf; sudo rm -r conf) < ${ISO_SQUASHFS_DIRECTORY}/${ISO_INITRD} 2>/dev/null) | sudo tee .disk/casper-uuid-generic > /dev/null
			find -path ./isolinux -prune -o -type f -print0 | sudo xargs -0 md5sum | sudo tee md5sum.txt > /dev/null
		else
			find -path ./isolinux/boot.cat -prune -o -type f -print0 | sudo xargs -0 md5sum | sudo tee md5sum.txt > /dev/null
		fi
		# new approach for respinning 20.10 ISOs and up
		if [ "${DISTRO_RELEASE}" == "21.10" -o "${DISTRO_RELEASE}" == "21.04" -o "${DISTRO_RELEASE}" == "20.10" ]; then
			sudo xorriso -as mkisofs -r -checksum_algorithm_iso md5,sha1 -J -joliet-long -l -volid "${ISO_VOLID}" \
				-b boot/grub/i386-pc/eltorito.img -no-emul-boot \
				-boot-load-size 4 -boot-info-table \
				--grub2-boot-info --grub2-mbr ../cd-boot-images/usr/share/cd-boot-images-amd64/images/boot/grub/i386-pc/boot_hybrid.img \
				-append_partition 2 0xef ../cd-boot-images/usr/share/cd-boot-images-amd64/images/boot/grub/efi.img -appended_part_as_gpt \
				-eltorito-alt-boot -e --interval\:appended_partition_2\:all\:\: -no-emul-boot \
				-partition_offset 16 \
				-o ../../${LINUXIUM_ISO} .
		else
			sudo xorriso -as mkisofs -rational-rock -checksum_algorithm_iso md5,sha1 -joliet -full-iso9660-filenames -volid "${ISO_VOLID}" \
				-isohybrid-mbr ../isohdpfx.bin \
				-eltorito-boot isolinux/isolinux.bin -no-emul-boot -eltorito-catalog isolinux/boot.cat -no-emul-boot \
				-boot-load-size 4 -boot-info-table -eltorito-alt-boot -e boot/grub/efi.img -no-emul-boot -isohybrid-gpt-basdat -isohybrid-apm-hfsplus \
				-o ../../${LINUXIUM_ISO} .
		fi
		cd ..
		sudo rm -rf cd-boot-images
		sudo rm -f isohdpfx.bin
	fi
	sudo chown $(stat -c '%u' ${ISO}):$(stat -c '%g' ${ISO}) ../${LINUXIUM_ISO}
	sudo rm -rf iso-directory-structure
	cd ${CWD}
	sudo mv ${WIP}/output/* ${WIP}/output/.* ${WIP} > /dev/null 2>&1
	sudo rm -rf ${WIP}/output
	sudo rm -f ${CWD}/.isorespin.sh.lock
	! ${EXTRACT_FILE} && sudo rm -rf ${WIP}
	if [ -z "${WORK_DIRECTORY}" ]; then
		CLOSE_DISPLAY_BOX
		${GUI} && zenity --info --title="isorespin.sh" --text="Respun ISO created as '${LINUXIUM_ISO}' ... see logfile '$(basename ${ISORESPIN_LOGFILE})' for details." 2> /dev/null
		echo "$(basename ${0}): Respun ISO created as '${LINUXIUM_ISO}' ... see logfile '$(basename ${ISORESPIN_LOGFILE})' for details."
		echo "Respun ISO created as '${LINUXIUM_ISO}'." >> ${ISORESPIN_LOGFILE} 2> /dev/null
	else
		CLOSE_DISPLAY_BOX
		${GUI} && zenity --info --title="isorespin.sh" --text="Respun ISO created as '${WORK_DIRECTORY}/${LINUXIUM_ISO}' ... see logfile '$(basename ${ISORESPIN_LOGFILE})' for details." 2> /dev/null
		echo "$(basename ${0}): Respun ISO created as '${WORK_DIRECTORY}/${LINUXIUM_ISO}' ... see logfile '$(basename ${ISORESPIN_LOGFILE})' for details."
		echo "Respun ISO created as '${WORK_DIRECTORY}/${LINUXIUM_ISO}'." >> ${ISORESPIN_LOGFILE} 2> /dev/null
	fi
}

# isorespin
CHECK_PACKAGE_DEPENDENCIES
CHECK_FOR_EXCLUSIVITY
NUMBER_OF_ARGUMENTS=${#}
if [ "${NUMBER_OF_ARGUMENTS}" == 0 ]; then
	if [ -n "${DISPLAY}" ]; then
		if [ ! $(sudo bash -c "command -v zenity") ]; then
			DISPLAY_MESSAGE "Install package 'zenity' for a minimalist GUI or an ISO must be specified using '-i' or '--iso'."
			DIRTY_EXIT
		else
			GUI=true
			USE_GUI_TO_GENERATE_CMDLINE
			CHECK_CMDLINE ${CMDLINE}
		fi
	else
		DISPLAY_MESSAGE "Cannot open display for GUI."
		USAGE
		rm -f ${ISORESPIN_LOGFILE}
		DIRTY_EXIT
	fi
else
	for QUOTED_OPTION in "$@"
	do
		if (expr index "${QUOTED_OPTION}" " " > /dev/null 2>&1); then
			QUOTED_CMDLINE+='"'"${QUOTED_OPTION}"'" '
		elif [ -n "${QUOTED_OPTION}" ]; then
			QUOTED_CMDLINE+="${QUOTED_OPTION} "
		else
			QUOTED_CMDLINE+='"" '
		fi
	done
	TEMPLATE=false
	EXPAND_CMDLINE_TEMPLATES ${QUOTED_CMDLINE}
	while [[ "${QUOTED_CMDLINE}" =~ " -t " ]] || [[ "${QUOTED_CMDLINE}" =~ " --template " ]]
	do
		EXPAND_CMDLINE_TEMPLATES ${QUOTED_CMDLINE}
	done
	CHECK_CMDLINE ${QUOTED_CMDLINE}
fi
CHECK_INTERNET_ACCESS
PROCESS_CMDLINE
EXTRACT_ISORESPIN_FILES
EXTRACT_ISO
if [ "${BOOT}" == "grub" -o "${BOOT}" == "grub-32" ]; then
	ADD_32BIT_GRUB_PACKAGES
fi
if ${SERVER_OPTION}; then
	SERVER_PREPROCESSING
fi
if ${UPDATE_KERNEL}; then
	FETCH_MAINLINE_DEBS
	INSTALL_MAINLINE_KERNEL
fi
if ${PURGE_PACKAGE}; then
	PURGE_PACKAGES
fi
if ${DIST_UPGRADE} || ${UPGRADE}; then
	UPGRADE_DISTRO
fi
if ${ADD_KEY}; then
	ADD_KEYS
fi
if ${ADD_REPOSITORY}; then
	ADD_REPOSITORIES
fi
if ${ADD_PACKAGE}; then
	INSTALL_PACKAGES
fi
if ${REMOVE_ROLLING_REPOSITORY}; then
	REMOVE_ROLLING_REPOSITORY
fi
if ${ADD_LOCAL_PACKAGE}; then
	INSTALL_LOCAL_PACKAGES
fi
if ${ADD_DOWNLOAD}; then
	DOWNLOAD_PACKAGES
fi
if ${ADD_FILE}; then
	ADD_FILES
fi
if ${ADD_COMMAND}; then
	RUN_COMMANDS
fi
if ${EXTRACT_FILE}; then
	EXTRACT_FILES
fi
if ${INTERACTIVE}; then
	INTERACTION
fi
UPDATE_BOOTLOADER
if ${SERVER_OPTION}; then
	SERVER_POSTPROCESSING
fi
UPDATE_ISO_PACKAGES
SPIN_ISO
exit 0
